using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using NHA.Helpers.HtmlStringCleaner;

namespace NHA.Testing.HtmlStringCleanerTests
{
    [TestClass]
    public class HtmlStringCleanerUnitTest
    {
        private const string simpleHtmlTestData =
            "<p>ON YOUR FEET SOLDIER WE ARE LEAVVINGGGG!!!</p><p>ON YOUR FEET SOLDIER WE ARE LEAVVINGGGG!!!</p><p>ON YOUR FEET SOLDIER WE ARE LEAVVINGGGG!!!</p><p>ON YOUR FEET SOLDIER WE ARE LEAVVINGGGG!!!</p><p>ON YOUR FEET SOLDIER WE ARE LEAVVINGGGG!!!<br></p>";

        private const string simpleHtmlExpectedResult =
            "<p>ON YOUR FEET SOLDIER WE ARE LEAVVINGGGG!!!</p><p>ON YOUR FEET SOLDIER WE ARE LEAVVINGGGG!!!</p><p>ON YOUR FEET SOLDIER WE ARE LEAVVINGGGG!!!</p><p>ON YOUR FEET SOLDIER WE ARE LEAVVINGGGG!!!</p><p>ON YOUR FEET SOLDIER WE ARE LEAVVINGGGG!!!<br></p>";

        private const string htmlWithFontColorAttributes =
            "<h1><font color=\"#ce0000\">sdfsfds</font></h1><h1><font color=\"#ce0000\">tosfsfd</font></h1><h1><font color=\"#ce0000\">qwl;erwlrejw;lerjkasfs</font></h1><h1><font color=\"#ce0000\">qwerwerwrerewr</font></h1>";

        private const string htmlWithFontColorExpectedResult =
            "<h1><font color=#ce0000>sdfsfds</font></h1><h1><font color=#ce0000>tosfsfd</font></h1><h1><font color=#ce0000>qwl;erwlrejw;lerjkasfs</font></h1><h1><font color=#ce0000>qwerwerwrerewr</font></h1>";

        private const string htmlWithImageSrc =
            "<p><img src=\"data:image/png;base64,\" data-filename=\"Ball.png\" style=\"width: 256px;\"><br></p>";

        private const string htmlWithImageSrcExpectedResult =
            "<p><img src=data:image/png;base64, data-filename=Ball.png style=width: 256px;><br></p>";


        [TestMethod]
        [DataTestMethod]
        [DataRow(simpleHtmlTestData, simpleHtmlExpectedResult)]
        [DataRow(htmlWithFontColorAttributes, htmlWithFontColorExpectedResult)]
        [DataRow(htmlWithImageSrc, htmlWithImageSrcExpectedResult)]
        public void CheckValidImageExtensions(string dirtyHtmlString, string expectedOutputHtml)
        {
            IHtmlStringCleaner cleaner = new HtmlStringCleaner();
            var cleanHtml = cleaner.Clean(dirtyHtmlString);
            Assert.AreEqual(expectedOutputHtml, cleanHtml);
        }
    }
}
